// src/pages/InvoicePage.jsx
import React, { useState } from "react";
import InvoiceCard from "../components/InvoiceCard";

const InvoicePage = () => {
  const [invoices] = useState([
    { id: 1, projectName: "Website Design", hours: 10, rate: 20, total: 200 },
    { id: 2, projectName: "React App", hours: 15, rate: 25, total: 375 },
  ]);

  const handleDownload = (invoice) => {
    alert(`Download PDF for ${invoice.projectName}`);
  };

  return (
    <div className="invoice-page">
      <h1>Invoices</h1>
      <div className="invoice-list">
        {invoices.map((inv) => (
          <InvoiceCard key={inv.id} invoice={inv} onDownload={handleDownload} />
        ))}
      </div>
    </div>
  );
};

export default InvoicePage;
